import React, { useState } from "react";

const menuItems = [
  { name: "Cynthia James", followers: 899, category: "UI/UX Designer" },
  { name: "Robert", followers: 150, category: "Senior Developer" },
  { name: "Ashley", followers: 115, category: "PHP Developer" },
  { name: "Joseph", followers: 999, category: "MERN Stack Developer" },
  { name: "Charles", followers: 125, category: "Full Stack Developer" },
  { name: "Cesar ", followers: 650, category: "Front-End Developer" },
  { name: "Mark", followers: 399, category: "Junior Developer" },
  { name: "Steven", followers: 799, category: "Designer" },
  { name: "Clark", followers: 199, category: "Back-End Developer" },
  { name: "Kimberly", followers: 179, category: "Graphics Designer" },
  { name: "Michelle", followers: 449, category: "Designer" },
];

const Extra = () => {
  const [products, setProducts] = useState([]);
  const [cart, setCart] = useState([]);

  return (
    <div className="App">
      {menuItems.map((product) => (
        <div key={product.name}>
          {product.name} - {product.followers} - {product.category}
        </div>
      ))}
      <h1>Cart:</h1>
      {cart.map((cartItem) => (
        <div key={cartItem.name}>
          {cartItem.name} - {cartItem.followers} - {cartItem.category}
        </div>
      ))}
    </div>
  );
};

export default Extra;
